    <script>
        $(document).ready(function () {
            function generate () {
                var certi = 'data:image/jpeg;base64,'
                var studentname = '{{$student->name}}';
                var fathername = '{{$student->father_name}}';
                var course = '{{$batch->course->title}}';
                var date = '{{$certificate->issue_date}}';
                var regid = '{{$certificate->registration_number}}';
                var grade = '{{$certificate->grade}}';
                var duration = '{{$batch->course->duration}}';
                var filename = 'sample-content';
                var doc = new jsPDF('landscape', 'mm', 'a4')
                doc.addImage(certi, 'JPEG', 0, 0, 297, 210)
                doc.setFont('Helvetica')

                /* Date*/
                doc.setFontSize(16)
                doc.text(53, 17.5, date)


                /* Registration Number */
                doc.setFontSize(16)
                doc.text(57, 9.5, regid)

                /* Student Name */
                doc.setFont('BebasNeue Regular_7', 'normal');

                console.log(studentname.length)
                if (studentname.length > 40) {
                    doc.setFontSize(20)
                    doc.text(70, 109, studentname)
                } else if (studentname.length > 35) {
                    doc.setFontSize(92)
                    doc.text(70, 109, studentname)
                } else if (studentname.length < 10) {
                    doc.setFontSize(75)
                    doc.text(70, 109, studentname)
                } else if (studentname.length < 20) {
                    doc.setFontSize(65)
                    doc.text(70, 109, studentname)
                } else {
                    doc.setFontSize(62)
                    doc.text(70, 109, studentname)
                }


                /* Father Name */
                if (fathername.length > 64) {
                    doc.setFontSize(36)
                    doc.text(64, 136, fathername)
                } else if (fathername.length > 32) {
                    doc.setFontSize(36)
                    doc.text(64, 136, fathername)
                } else if (fathername.length < 10) {
                    doc.setFontSize(36)
                    doc.text(64, 136, fathername)
                } else if (fathername.length < 20) {
                    doc.setFontSize(36)
                    doc.text(64, 136, fathername)
                } else {
                    doc.setFontSize(30)
                    doc.text(64, 136, fathername)
                }

                /* Course Name */
                if (course.length > 64) {
                    doc.setFontSize(36)
                    doc.text(174, 136, course)
                } else if (course.length > 32) {
                    doc.setFontSize(36)
                    doc.text(174, 136, course)
                } else {
                    doc.setFontSize(36)
                    doc.text(174, 136, course)
                }

                doc.setFont('Helvetica')

                /* Date of the Grade */
                doc.setTextColor(198, 33, 40);
                if (course.length === 2) {
                    doc.setFontSize(32)

                    doc.text(220, 161, grade)
                } else {
                    doc.setFontSize(38)
                    doc.text(225, 161, grade)
                }

                /* Duration */

                doc.setFontSize(16)
                doc.setTextColor(0, 0, 0);
                doc.text(153, 154, duration)


                // doc.save( filename +'.pdf')

                // var string = doc.output('datauristring');
                // var embed = "<embed width='100%' height='100%' src='" + string + "'/>"
                // var x = window.open();
                // x.document.open();
                // x.document.write(embed);
                // x.document.close();

                PDFObject.embed(doc.output('datauristring'), "#sample");


            }
            generate();
        });

    </script>
